def test_bracket():
    kp.settings.allowed_moves="r1,r2,r3,flype"

    knotoids = [kp.from_knotpy_notation(_) for _ in knotoid_codes.split("\n") if _][::80]

    for k in knotoids[::5]:
        assert kp.sanity_check(k)
        p = kp.kauffman_bracket_skein_module(k, normalize=True)
        for k_ in kp.all_reidemeister_moves(k, depth=1):
            p_ = kp.kauffman_bracket_skein_module(k, normalize=True)
            assert p == p_, f"{p} vs {p_}"
        for f in kp.find_flypes(k):
            fk = kp.flype(k, f)
            p_ = kp.kauffman_bracket_skein_module(fk, normalize=True)
            assert kp.sanity_check(fk)
            assert p_ == p, f"{p} vs {p_}"


