def test_arrow():
    kp.settings.allowed_moves="r1,r2,r3,flype"

    knotoids = [kp.from_knotpy_notation(_) for _ in knotoid_codes.split("\n") if _][::100]

    for k in knotoids:
        print(k)
        assert kp.sanity_check(k)
        p = kp.arrow_polynomial(k, normalize=True)
        for i, k_ in enumerate(kp.all_reidemeister_moves(k, depth=1)):
            if i%10:continue
            p_ = kp.arrow_polynomial(k, normalize=True)
            assert p == p_, f"{p} vs {p_}"
        for f in kp.find_flypes(k):
            fk = kp.flype(k, f)
            p_ = kp.arrow_polynomial(fk, normalize=True)
            assert kp.sanity_check(fk)
            assert p_ == p, f"{p} vs {p_}"


